INSERT INTO ceds6sc_rdx.Ref_Alternate_Fund_Uses( Ref_Alternate_Fund_Uses_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Ensuring the continued validity and reliability of State assessments', '04', 'Ensuring the continued validity and reliability of State assessments, and/or refining State assessments to ensure their continued alignment with the State''s academic content standards and to improve the alignment of curricula and instructional materials', null, 4.00 ); 
