INSERT INTO ceds6sc_rdx.Ref_Alternate_Fund_Uses( Ref_Alternate_Fund_Uses_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Strengthening the capacity of local educational agencies and schools', '06', 'Strengthening the capacity of local educational agencies and schools to provide all students the opportunity to increase educational achievement, including carrying out professional development activities aligned with State student academic achievement standards and assessments', null, 6.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Alternate_Fund_Uses( Ref_Alternate_Fund_Uses_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'Expanding range of accommodations to students with LEP and students with disabilities (IDEA)', '07', 'Expanding the range of accommodations available to students with limited English proficiency and students with disabilities (IDEA) to improve the rates of inclusion of such students, including professional development activities aligned with State academic achievement standards and assessments', null, 7.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Alternate_Fund_Uses( Ref_Alternate_Fund_Uses_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 8, 'Improving the dissemination of information on student achievement and school  performance', '08', 'Improving the dissemination of information on student achievement and school  performance to parents and the community, including the development of information and reporting systems designed to identify best educational practices based on  scientifically based research or to assist in linking records of student achievement, length of enrollment, and graduation over time', null, 8.00 ); 
