INSERT INTO ceds6sc_rdx.Ref_Child_Outcomes_Summary_Rating( Ref_Child_Outcomes_Summary_Rating_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Does not show functioning expected at age - does not include immediate foundational skills', '01', 'Child does not yet show functioning expected of a child his or her age in any situation. Child?s functioning does not yet include immediate foundational skills upon which to build age-appropriate functioning. Child functioning reflects skills that developmentally come before immediate foundational skills.', null, 2.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Child_Outcomes_Summary_Rating( Ref_Child_Outcomes_Summary_Rating_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Occasionally uses immediate foundational skills across settings and situations', '02', 'Child occasionally uses immediate foundational skills across settings and situations.  More functioning reflects skills that are not immediate foundational than are immediate foundational.', null, 4.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Child_Outcomes_Summary_Rating( Ref_Child_Outcomes_Summary_Rating_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Does not show functioning expected at age - uses immediate foundational skills', '03', 'Child does not yet show functioning expected of a child of his or her age in any situation. Child uses immediate foundational skills, most or all of the time, across settings and situations. Immediate foundational skills are the skills upon which to build age-appropriate functioning.', null, 6.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Child_Outcomes_Summary_Rating( Ref_Child_Outcomes_Summary_Rating_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Shows occasional age-appropriate functioning across settings and situations', '04', 'Child shows occasional age-appropriate functioning across settings and situations. More functioning is not age-appropriate than age-appropriate.', null, 8.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Child_Outcomes_Summary_Rating( Ref_Child_Outcomes_Summary_Rating_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Shows functioning expected at age some of the time and/or in some settings and situations', '05', 'Child shows functioning expected for his or her age some of the time and/or in some settings and situations. Child?s functioning is a mix of age-appropriate and not age-appropriate behaviors and skills.', null, 10.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Child_Outcomes_Summary_Rating( Ref_Child_Outcomes_Summary_Rating_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Functioning generally is considered appropriate for age but there are some significant concerns', '06', 'Child?s functioning generally is considered appropriate for his or her age but there are some significant concerns about the child?s functioning in this outcome area. These concerns are substantial enough to suggest monitoring or possible additional support.', null, 12.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Child_Outcomes_Summary_Rating( Ref_Child_Outcomes_Summary_Rating_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'Shows functioning expected for age in all or almost all everyday situations', '07', 'Child shows functioning expected for his or her age in all or almost all everyday situations that are part of the child?s life. Functioning is considered appropriate for his or her age.', null, 14.00 ); 
