INSERT INTO ceds6sc_rdx.Ref_Financial_Expenditure_Level_Of_Instruction_Code( Ref_Financial_Expenditure_Level_Of_Instruction_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Elementary', '10', 'A school organization classified as elementary by state and local practice and composed of any span of grades from Pre_Kindergarten_, kindergarten, or grade 1 through grade 8.', null, 1.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Expenditure_Level_Of_Instruction_Code( Ref_Financial_Expenditure_Level_Of_Instruction_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Pre_Kindergarten_', '11', 'A school organization composed entirely of any span of ages below kindergarten. This category is normally used for students identified as needing special services, although regular education Pre_Kindergarten_ would also be appropriate.', null, 2.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Expenditure_Level_Of_Instruction_Code( Ref_Financial_Expenditure_Level_Of_Instruction_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Kindergarten', '12', 'A school organization for children in the year immediately preceding first grade.', null, 3.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Expenditure_Level_Of_Instruction_Code( Ref_Financial_Expenditure_Level_Of_Instruction_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Other Elementary', '19', 'A school organization composed of any span of grades not above grade 8, except Pre_Kindergarten_ and kindergarten.', null, 4.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Expenditure_Level_Of_Instruction_Code( Ref_Financial_Expenditure_Level_Of_Instruction_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Middle', '20', 'A school organization composed of at least three grades, usually beginning with grade 4 through grade 6 or the equivalent and usually ending with grade 8 or grade 9. Most middle school organizations presume that students finishing middle school will go on to secondary school.', null, 5.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Expenditure_Level_Of_Instruction_Code( Ref_Financial_Expenditure_Level_Of_Instruction_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Secondary', '30', 'A school organization comprising any span of grades beginning with the next grade following an elementary or middle school, usually beginning with grade 7 through grade 10, and ending with or below grade 12.', null, 6.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Expenditure_Level_Of_Instruction_Code( Ref_Financial_Expenditure_Level_Of_Instruction_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'Elementary and Secondary Combined', '37', 'A school organization comprising elementary and secondary levels of instruction, which may also include kindergarten and Pre_Kindergarten_ programs.', null, 7.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Expenditure_Level_Of_Instruction_Code( Ref_Financial_Expenditure_Level_Of_Instruction_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 8, 'Postsecondary', '40', 'A school organization providing formal instructional programs with a curriculum designed primarily for students who have completed the requirements for a high school diploma or the equivalent. This includes programs of an academic, vocational, and continuing professional education purpose and excludes avocational and adult education programs.', null, 8.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Expenditure_Level_Of_Instruction_Code( Ref_Financial_Expenditure_Level_Of_Instruction_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 9, 'Programs for Adult/Continuing', '41', 'A program for adults and out-of-school youth (typically 16 years of age and older who are not regularly enrolled in school) who have completed, interrupted, or not begun their formal education and are pursuing skills or knowledge in other than regularly prescribed courses. These include adult basic education programs and other programs for the pursuit of special interests or enrichment.', null, 9.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Expenditure_Level_Of_Instruction_Code( Ref_Financial_Expenditure_Level_Of_Instruction_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 10, 'Community/Junior College', '42', 'An institution of higher education that usually offers the first 2 years of college instruction and frequently grants an associate''s degree, but does not grant a bachelor''s degree. It is an independently organized institution (public or nonpublic), an institution that is part of a school district, or an independently organized system of junior colleges. Junior colleges offer college transfer courses and programs; vocational, technical, and semiprofessional occupational programs; or general education programs.', null, 10.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Financial_Expenditure_Level_Of_Instruction_Code( Ref_Financial_Expenditure_Level_Of_Instruction_Code_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 11, 'School Wide', '50', 'For coding expenditures that cannot be clearly assigned to a specific instructional level.', null, 11.00 ); 
